import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import '../styling/recommendations.css';

const Recommendations = () => {
  const { mood } = useParams(); // <-- Grab the mood from URL
  const navigate = useNavigate();
  const [recommendations, setRecommendations] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  // Hardcoded mood-based song recommendations with unique cover images
  const moodSongs = {
    happy: [
      { id: 1, title: "Good as Hell", artist: "Lizzo", duration: "2:39", cover: "/api/placeholder/300/300", preview: "" },
      { id: 2, title: "I Wanna Dance with Somebody", artist: "Whitney Houston", duration: "4:52", cover: "/api/placeholder/300/300", preview: "" },
      { id: 3, title: "Uptown Funk", artist: "Mark Ronson ft. Bruno Mars", duration: "4:30", cover: "/api/placeholder/300/300", preview: "" }
    ],
    sad: [
      { id: 4, title: "Glimpse of Us", artist: "Joji", duration: "3:53", cover: "/api/placeholder/300/300", preview: "" },
      { id: 5, title: "drivers license", artist: "Olivia Rodrigo", duration: "4:02", cover: "/api/placeholder/300/300", preview: "" },
      { id: 6, title: "Heather", artist: "Conan Gray", duration: "3:18", cover: "/api/placeholder/300/300", preview: "" }
    ],
    energetic: [
      { id: 7, title: "Blinding Lights", artist: "The Weeknd", duration: "3:20", cover: "/api/placeholder/300/300", preview: "" },
      { id: 8, title: "Physical", artist: "Dua Lipa", duration: "3:42", cover: "/api/placeholder/300/300", preview: "" },
      { id: 9, title: "Industry Baby", artist: "Lil Nas X ft. Jack Harlow", duration: "3:32", cover: "/api/placeholder/300/300", preview: "" }
    ],
    calm: [
      { id: 10, title: "Pink + White", artist: "Frank Ocean", duration: "3:04", cover: "/api/placeholder/300/300", preview: "" },
      { id: 11, title: "Malibu Nights", artist: "LANY", duration: "5:26", cover: "/api/placeholder/300/300", preview: "" },
      { id: 12, title: "Godspeed", artist: "James Blake", duration: "2:53", cover: "/api/placeholder/300/300", preview: "" }
    ],
    romantic: [
      { id: 13, title: "Love On The Brain", artist: "Rihanna", duration: "3:44", cover: "/api/placeholder/300/300", preview: "" },
      { id: 14, title: "Die For You", artist: "The Weeknd", duration: "4:20", cover: "/api/placeholder/300/300", preview: "" },
      { id: 15, title: "Put Your Head On My Shoulder", artist: "Paul Anka", duration: "2:42", cover: "/api/placeholder/300/300", preview: "" }
    ],
    focus: [
      { id: 16, title: "Experience", artist: "Ludovico Einaudi", duration: "5:15", cover: "/api/placeholder/300/300", preview: "" },
      { id: 17, title: "Letting Go", artist: "BÃ¼low", duration: "2:43", cover: "/api/placeholder/300/300", preview: "" },
      { id: 18, title: "Midnight City", artist: "M83", duration: "4:03", cover: "/api/placeholder/300/300", preview: "" }
    ]
  };

  useEffect(() => {
    const lowerMood = mood?.toLowerCase();
    const moodData = moodSongs[lowerMood];

    if (moodData) {
      setRecommendations(moodData);
    } else {
      setRecommendations([]);
    }
    setIsLoading(false);
  }, [mood]);

  const handleBack = () => {
    navigate('/dashboard');
  };

  return (
    <div className="recommendations-page">
      <div className="recommendations-header">
        <h1>{mood ? `${mood.charAt(0).toUpperCase() + mood.slice(1)} Vibes` : "Mood Vibes"}</h1>
        <button onClick={handleBack}>â Back</button>
      </div>

      {isLoading ? (
        <div className="loading">
          <div className="spinner"></div>
          <p>Loading recommendations...</p>
        </div>
      ) : (
        <div className="recommendations-list">
          {recommendations.length > 0 ? (
            recommendations.map((song) => (
              <div key={song.id} className="song-card">
                <img src={song.cover} alt={`${song.title} by ${song.artist}`} />
                <div className="play-button">
                  <span className="play-icon">â¶</span>
                </div>
                <div className="song-info">
                  <h3>{song.title}</h3>
                  <p>{song.artist}</p>
                  <span>{song.duration}</span>
                </div>
              </div>
            ))
          ) : (
            <div className="no-results">
              <p>No songs found for this mood.</p>
              <button className="try-again-button" onClick={handleBack}>Try Another Mood</button>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default Recommendations
